Titanic's Final Mystery

History Documentary hosted by Bill Ratner, published by Smithsonian Channel in 2012 - English narration


Information
------------------------------

A century ago, the &quot;unsinkable&quot; Titanic plunged to the bottom of the North Atlantic Ocean. With each passing year, the myth surrounding the ship has grown, as have arguments over why and how she met her demise. However, a recent study blows all other theories out of the water. Follow Titanic detective Tim Maltin as he shares the results of his 20-year investigation. Combining thousands of hours of eyewitness testimony with modern scientific investigation, he reveals that the real culprits may have been forces beyond human control

